// App.tsx

import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PrivateRoute from './PrivateRoute';
import StudentList from './components/StudentList';
import LoginForm from './components/LoginForm';
import RegisterForm from './components/RegisterForm';

interface Student {
  _id: string;
  name: string;
  email: string;
  learningStyle: string[];
}

function App() {
  const [students, setStudents] = useState<Student[]>([
    { _id: '1', name: 'John Doe', email: 'john.doe@example.com', learningStyle: ['Visual', 'Auditory'] },
    { _id: '2', name: 'Jane Smith', email: 'jane.smith@example.com', learningStyle: ['Kinesthetic'] },
  ]);

  const handleDelete = (studentId: string) => {
    // Filtra los estudiantes para eliminar el estudiante con studentId
    const updatedStudents = students.filter(student => student._id !== studentId);
    setStudents(updatedStudents);
  };

  return (
    <Router>
      <Routes>
        <Route path="/login" element={<LoginForm />} />
        <Route path="/register" element={<RegisterForm />} />
        <PrivateRoute path="/dashboard" element={<StudentList students={students} onDelete={handleDelete} />} />
        <Route path="/" element={<LoginForm />} />
      </Routes>
    </Router>
  );
}

export default App;
